// css
import "../css/index.css";

import React, { memo, useEffect, useState } from "react";

export const PageHeader = () => {
  let [SearchInput, setSearchInput] = useState<string>("");

  useEffect(() => {
    const url =
      "https://api.themoviedb.org/3/account/10605614/rated/movies?language=en-US&page=1&sort_by=created_at.asc";
    const options = {
      method: "GET",
      headers: {
        accept: "application/json",
        Authorization:
          "Bearer eyJhbGciOiJIUzI1NiJ9.eyJhdWQiOiJjMTcxOGJhYjg3YWI2Zjk1NzkxYzcxMThmODY0MDEzOCIsIm5iZiI6MTYyMzM4NjYwOS45MjQsInN1YiI6IjYwYzJlOWYxYzFmZmJkMDA1MDc4OTQwZiIsInNjb3BlcyI6WyJhcGlfcmVhZCJdLCJ2ZXJzaW9uIjoxfQ.o8c809j6bo8quoH6NdeKwFsbMiYr4Nj7mLdWl6kdebU",
      },
    };

    fetch(url, options)
      .then((res) => res.json())
      .then((json) => console.log(json))
      .catch((err) => console.error(err));

    let test = async () => {
      try {
        let res = await fetch(url, options);
        console.log(res);
      } catch (err) {
        alert(err);
      }
    };

    test();
  }, []);

  return <header className="page_header">hi</header>;
};
